buy trades._queryString:
{[coin;exchange;minSize;current;startTime;endTime;window]
  $[current;
    tab:queryData[`trade;.z.p-`minute$window;.z.p;coin;exchange];
    tab:queryData[`trade;startTime;endTime;coin;exchange]
  ];
  $[99h ~ abs type tab;
    :([]time:();price:();amount:());
    :select time, price, amount from tab where side =`buy, amount > minSize]
  }

