vwapDepth._queryString:
{[coin;exchange;current;startTime;endTime;window;bucket]
  vwap_depth:{$[any z<=s:sums x;(deltas z & s) wavg y;0nf]};
  $[current;
    tab:queryData[`book;.z.p-`minute$window;.z.p;coin;exchange];
    tab:queryData[`book;startTime;endTime;coin;exchange]
  ];
  $[99h ~ abs type tab;
    :([]time:();vwap_bid_1:();vwap_bid_100:();vwap_bid_10000:();vwap_bid_1000000:();vwap_ask_1:();vwap_ask_100:();vwap_ask_10000:();vwap_ask_1000000:());
    delete second from select first time, vwap_bid_1:avg vwap_depth'[bidsizes;bids;1], vwap_bid_100:avg vwap_depth'[bidsizes;bids;100] , vwap_bid_10000:avg vwap_depth'[bidsizes;bids;10000], vwap_bid_1000000:avg vwap_depth'[bidsizes;bids;1000000] , vwap_ask_1:avg vwap_depth'[asksizes;asks;1], vwap_ask_100:avg vwap_depth'[asksizes;asks;100]  , vwap_ask_10000:avg vwap_depth'[asksizes;asks;10000],  vwap_ask_1000000:avg vwap_depth'[asksizes;asks;1000000] by bucket xbar time.second from tab
    ]
  }

